import { theme } from "@chakra-ui/core";
import { customIcons } from "./lib/icons";

const bgColor = { light: "red.500", dark: "red.200" };
const color = { light: "white", dark: "gray.800" };

export default {
  ...theme,
  icons: {
    ...theme.icons,
    ...customIcons,
  },
};
